import {
  WelcomeWrapper,
  WelcomeCard,
  WelcomeProfile,
  ImageWrapper
} from './welcome.style';
import { withToastManager } from 'react-toast-notifications';
import { ImageProfile } from '@components';
import Input from '../../components/Utils/Input';



// import PropTypes from 'prop-types';
